{pageSize=3000, sqlText= SELECT  customer,bay,mesmodel,route_step_name,route, year(routesteptime) as event_year,month(routesteptime) as event_month,day(routesteptime) as event_day,hour(routesteptime) as event_hour,test_status,count(1) as total_count 
                                FROM (
                                        select * from (select *,ROW_NUMBER() over (PARTITION BY  serial_number, route_step_name ORDER BY  routesteptime asc ) as RowIndex from  s2_a_meswip_allstep 
                                        where   routesteptime>='2025-03-31 22:00:00' and routesteptime <'2025-03-31 23:00:00') a where RowIndex=1 
                                    ) a group by customer,bay,mesmodel,route_step_name,route, year(routesteptime),month(routesteptime),day(routesteptime),hour(routesteptime),test_status  , pageNum=1}

